import React, { useEffect, useState } from 'react';
import { Box, Typography, Paper, Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material';
import api from '../services/api';

export default function Dividen() {
  const [data, setData] = useState([]);

  const fetchDividen = async()=>{
    try {
      const res = await api.get('/finance/dividens');
      setData(res.data);
    } catch(err) {
      alert('Gagal memuat data Dividen');
    }
  };

  useEffect(()=>{
    fetchDividen();
  },[]);

  return (
    <Box>
      <Typography variant="h5" sx={{ fontWeight:700, mb:2 }}>
        Dividen Management
      </Typography>
      <Paper sx={{ p:2 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor:'#f5f5f5' }}>
              <TableCell>ID</TableCell>
              <TableCell>Tanggal</TableCell>
              <TableCell>Total Profit</TableCell>
              <TableCell>Catatan</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((row)=>(
              <TableRow key={row.id}>
                <TableCell>{row.id}</TableCell>
                <TableCell>{new Date(row.distributedAt).toLocaleDateString()}</TableCell>
                <TableCell>{row.totalProfit}</TableCell>
                <TableCell>{row.notes}</TableCell>
                <TableCell>{row.status}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Box>
  );
}
